import sys

sys.stdin = open('input.txt', 'r')


for tc in range(10):
    T = int(input())
    ladder = []

    for i in range(100):
        ladder.append( list(map(int, input().split()) ))
    
    res = 0
    x = ladder[99].index(2)
    k = 99
    if(ladder[k][x] == 2):
        while(k != 0):
            if(x > 0 and ladder[k][x-1] == 1):
                while(x > 0 and ladder[k][x-1] != 0):
                    x -= 1
                k -= 1
            elif(x <99 and ladder[k][x+1] == 1):
                while(x <99 and ladder[k][x+1] != 0):
                    x += 1
                k -= 1
            else:
                k -= 1

            if(k == 0):
                res = x
                break
    
    print(f"#{tc+1} {res}")




